import React from "react";


const RetList = (props) =>{
   
    const RemoveElement = (event)=>{
        console.log(event.target.id); 
        props.SetV((preVal)=>{
            console.log(preVal);
            return preVal ; 
        });

    }
    const data = props.data.map((val , index)=>{
        return (
        <p key={index}><button id ={index}className="btnSub"onClick={RemoveElement}>
        -</button> {val} {index}
        </p>
         );
    }) ; 
    return data ; 
}

export default RetList ;
